function showPage(group, number, noHist) {
  if (number === undefined && typeof group === "string") {
    var groupAndN = group.split("$");
    group = groupAndN[0];
    number = Number(groupAndN[1])||0;
  }

  if (this.state.embeddedMorphs) this.state.embeddedMorphs.forEach(function(ea) { this.removeMorphFromMarkdown(ea); }, this);
  this.state.embeddedMorphs = null;

  if (this.pageNode()) {
    var titleNode = this.pageNode().querySelector(".title");
    !noHist && this.state.history.push({
      id: this.state.page,
      title: titleNode ? titleNode.textContent : this.state.page});
  }
  this.state.page = group+"$"+number;
  this.render();
  this.onStateChange(this.state);
  this.focus();
}

