function showHoverVideo(hoveredEl, videoName, extent) {
  var self = this;
  // var defaultExtent = pt(200,100);
  // this.render();
  var loaded = false;

  // if mouse moved away before video started:
  var canceled = false;
  hoveredEl.addEventListener('mouseout', onOut);
  function onOut(evt) { canceled = true; loader && loader.remove(); hoveredEl.removeEventListener('mouseout', onOut); }

  var loader;
  lively.morphic.Image.fromURL(Global.URL.root.withFilename("core/media/loader-small.png"), rect(0,0,18,18), function(err, _loader) {
    if (canceled || loaded) return;
    loader = _loader;
    loader.setOrigin(loader.getExtent().scaleBy(.5));
    loader.startStepping(10, "rotateBy", .1);
    loader.align(loader.bounds().topLeft(), lively.Rectangle.fromElement(hoveredEl).topRight());
    loader.openInWorld();
  });

  this.videoMorph(videoName, extent, function(err, v) {
    loaded = true;
    hoveredEl.removeEventListener('mouseout', onOut);
    loader && loader.remove();
    if (!v || canceled) return;
    self.addMorph(v);
    align(v);
    self.showMorphWhileHover(hoveredEl, v);
    v.play();
    v.applyStyle({borderWidth: 1, borderColor: Global.Color.gray})
    v.addScript(function onMouseOut() { this.remove(); })
  });

  function align(morph) {
    var s = $world.getScroll();
    var elBounds = lively.Rectangle.fromElement(hoveredEl).translatedBy(pt(s[0], s[1]));
    morph.align(morph.globalBounds().topCenter(), elBounds.bottomCenter());
  }

}

