function mdInsertMorph(text) {
  var match = lively.lang.string.unescapeCharacterEntities(text).match(/morph(:?)(.*)/);
  if (!match) return "unable to read morph embed";
  var inner = match[2];
  return lively.lang.string.format("<div class=\"embed-morph\">%s</div>", inner);
}

